import React from 'react';
import * as ReactBootStrap from "react-bootstrap";
import { useState, useEffect } from 'react';
//import { Button } from './Button';
import { Link } from 'react-router-dom';
import './Navbar.css';
import { Dropdown } from 'bootstrap';
import NavbarToggle from 'react-bootstrap/esm/NavbarToggle';
import { Container, Image, NavbarBrand } from 'react-bootstrap';

function Navbar() {
  const [click, setClick] = useState(false);
  const [button, setButton] = useState(true);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const showButton = () => {
    if (window.innerWidth <= 960) {
      setButton(false);
    } else {
      setButton(true);
    }
  };

  useEffect(() => {
    showButton();
  }, []);

  window.addEventListener('resize', showButton);

  return (
    <>
    <nav class="navbar navbar-expand-lg navbar-light bg-primary">
    <div class="container-fluid">
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <Link to='/' className='navbar-logo' onClick={closeMobileMenu}>
            helpr
            <i class='fab fa-typo3' />
    </Link>
    <div class="collapse navbar-collapse" id="navbarNavDropdown">
      <ul class="navbar-nav">
        {/* <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="#">helpr</a>
        </li> */}

        <li class="nav-item dropdown">
          <a class="nav-link dropdown-toggle" href="#" id="navbarDropdownMenuLink" role="button" data-bs-toggle="dropdown" aria-expanded="false">
            Services
          </a>
          <ul class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
            <li><a class="dropdown-item" href="#">Cleaning</a></li>
            <li><a class="dropdown-item" href="#">Pest Control</a></li>
            <li><a class="dropdown-item" href="#">Courior Service</a></li>
            <li><a class="dropdown-item" href="#">Relocation</a></li>
          </ul>
        </li>

        <li class=""><a href="cleaning" class="dropdwn">Services</a>
                            <ul>
      <li class=""><a href="cleaning" class="clearfix"><div class="cln_cir nav_cir"></div><span>Cleaning</span></a></li>
      <li class=""><a href="pestcontrol" class="clearfix"><div class="pest_cir nav_cir"></div><span>Pest Control</span></a></li>
       <li class=""><a href="courierservice" class="clearfix"><div class="computer_cir nav_cir"></div><span>Courier Services</span></a></li>
       <li class=""><a href="relocation" class="clearfix"><div class="vehicle_cir nav_cir"></div><span>Relocation</span></a></li>

    </ul></li>

        <li class="nav-item">
          <a class="nav-link" href="#">Features</a>
        </li>

        <li class="nav-item">
          <a class="nav-link" href="#">Pricing</a>
        </li>

        <li class="nav-item dropdown">
          <a class="nav-link dropdown-toggle" href="#" id="navbarDropdownMenuLink" role="button" data-bs-toggle="dropdown" aria-expanded="false">
            Dropdown link
          </a>
          <ul class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
            <li><a class="dropdown-item" href="#">Action</a></li>
            <li><a class="dropdown-item" href="#">Another action</a></li>
            <li><a class="dropdown-item" href="#">Something else here</a></li>
          </ul>
        </li>
      </ul>
    </div>
  </div>
</nav>

    </>
  );
}

export default Navbar;
